import React, { useEffect } from 'react';
import IsAuthenticated from '../functions/IsAuthenticated';
import { useNavigate } from 'react-router-dom';
import { useCookies } from 'react-cookie';
import GetUserDetails from '../functions/GetUserDetails';
import { Link } from 'react-router-dom';
// import HomeHeader from '../subpages/HomeHeader';
import MaterialIcon from 'material-icons-react';
// import HomeBody2 from '../subpages/HomeBody2';
import '../css/Home.css';
import logo from '../images/logo.webp';
const HomePage = () => {
  const navigate = useNavigate();
  const { authenticated, loading } = IsAuthenticated();
  // const [cookies, setCookie, removeCookie] = useCookies(['token']);
  if (!authenticated) {
    navigate('/login');
  }

  // const logout = () => {
  //   removeCookie('token');
  //   navigate('/login');
  // };
  const { userDetails } = GetUserDetails();

  return (
    <>
      <div className="home_page">
        {userDetails ? (
          <>
            <div className="container">
              <div className="dashboard">
                <div className="left">
                  <div className="logo">
                    <Link to="#" id="logo">
                      <img src={logo} alt="" />
                      <span>
                        <h2>Logo</h2>
                      </span>
                    </Link>
                  </div>
                  <div className="sidebar">
                    <Link to="#">
                      <div className="group-icon-text">
                        <div
                          className="icons-bg"
                          id="dashboard-id"
                          onclick="active()"
                        >
                          <span className="material-symbols-outlined">
                            <MaterialIcon icon="dashboard" id="icon-color-1" />
                          </span>
                        </div>
                        <p>Dashboard</p>
                      </div>
                    </Link>
                    <Link to="#">
                      <div className="group-icon-text">
                        <div className="icons-bg">
                          <span className="material-symbols-outlined">
                            <MaterialIcon icon="person" id="icon-color-2" />
                          </span>
                        </div>
                        <p>Attendance</p>
                      </div>
                    </Link>
                    <Link to="#">
                      <div className="group-icon-text">
                        <div className="icons-bg">
                          <span className="material-symbols-outlined">
                            <MaterialIcon
                              icon="calendar_today"
                              id="icon-color-3"
                            />
                          </span>
                        </div>
                        <p>Calendar</p>
                      </div>
                    </Link>

                    <Link to="#">
                      <div className="group-icon-text">
                        <div className="icons-bg">
                          <span className="material-symbols-outlined">
                            <MaterialIcon icon="settings" id="icon-color-4" />
                          </span>
                        </div>
                        <p>Settings</p>
                      </div>
                    </Link>
                  </div>
                </div>
                <div className="right">Helloa World</div>
              </div>
            </div>
          </>
        ) : (
          <p>Loading user details...</p>
        )}
      </div>
    </>
  );
};

export default HomePage;
